drop DATABASE `pmse`;
CREATE DATABASE `pmse`;
USE `pmse`;

create table web_web(
	wid int unsigned NOT NULL AUTO_INCREMENT,
	grank int unsigned NOT NULL,
	keyword varchar(255),
	title varchar(1000),
	url varchar(1000),
  descryption varchar(1000),
	category varchar(255),
	hits int unsigned,
	PRIMARY KEY(wid)
);

CREATE TABLE `users` (
  `email` VARCHAR(255) NOT NULL,
  `password` TEXT NULL,
  `usertype` TEXT NULL,
  PRIMARY KEY (`email` ASC)
);

CREATE TABLE `activity` (
  `email` VARCHAR(255) NOT NULL,
  `keyword` varchar(255),
  `wid` TEXT NULL,
  `searchdate` datetime NOT NULL,
  PRIMARY KEY (email,keyword)
);



